import axios from "axios";

const Index = (props) => {
  console.log(props);
  return (
    <div>
      <h1>Hello This is the Index Page</h1>
      <ul>
        {props.posts.map((item) => (
          <li>{item}</li>
        ))}
      </ul>
    </div>
  );
};

Index.getInitialProps = async () => {
  const res = await axios.get("https://jsonplaceholder.typicode.com/posts");
  const { data } = res;
  console.log(data[0]);
  return { posts: data };
};

export default Index;
